script: |
  super -f text -I q12760.spq | sort > q12760.out

inputs:
  - name: q12760.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 IN ( 40, col2 + + col1, + - col2, + col0 / 27 * - 13 + - 91, - - 60 + - col1 * + 77 + + + col1, - - col2 );
  - name: tab0

outputs:
  - name: q12760.out
    data: |
      15	81	47
      87	21	10
      97	1	99
